    # the grouping is {1, x, xz, xz}
    @testset let grouping=SimpleMonomialVector{4,2}(UInt[1, 8, 79, 729])
        # the constraint is {{4xx - (2 + 6I)z + 8zz - (2 - 6I)z, 18x, 10x + 8zz}, {18x, 0, (24I)xz - (24I)xz}, {10x + 8zz, (24I)xz - (24I)xz, 6xx}}
